import React from 'react';
import ReturnProFil from './Profil';
import { auth } from '../firebase';
import SignUp from '../Sign/Main';

// Profil Main component 
export default function ProFil() {

 const user = auth.currentUser;
 const [loading, setLoading] = React.useState(true);
 const [people, setPeople] = React.useState(user);

 React.useEffect(() => {

  // setLoading(true);
  setTimeout(() => {
   setLoading(false);
  }, 3600);

  if (user) {
   setTimeout(() => {
    setPeople(true);
   }, 600);

  }
  window.console.log(people);

 }, []);

 return (
  <>
   {people ? <ReturnProFil /> : <SignUp />}
  </>
 );
};
